Justice League Beyond 2.0 001 Power Struggle - System Errors, Part 1 (2013)

&quot;The World's Greatest Super Heroes of Tomorrow are here! Now with a few fresh faces and a newly-constructed Watchtower, the Justice League are back to being a well-oiled crime fighting machine. But when Superman's powers begin to rage out of control, the League must figure out a way to protect the world--and themselves--from the Last Son of Krypton!&quot;



Noticed this wasn't uploaded yet so here is the latest issue for those interested or anyone following the series. Enjoy!


